// React-Redux
import React from "react";
import { render } from "react-dom";
import { Provider } from "react-redux";
import store from "./store/index";
import App from "./components2/App";

render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById("app")
);
